import React from 'react';
import Home from './Home';
import Contact from './Contact';
import About from './About';
import Services from './Services';

function App() {
  return (
    <>
    <Switch>
      <Home />
      <Route />
      <Contact />
      <About />
      <Services />
      </Switch>
    </>
  );
}

export default App;
